REPLACE INTO `projects` (`id`, `slug`, `title`, `year_start`, `year_end`, `description`) VALUES
	(1, 'echo-no-echo', 'Echo No Echo', '2006', '0000', 'In some ways this is a band that never really existed. An opportunity arose to play a show at The Crystal Ballroom opening for Information Society on their big comeback show. I threw the idea out to Christian that he should get the final incarnation of Poncherello together and they should play the show. After a little coercing I jumped on board and we decided not to do Poncherello songs, but come up with new material. Camelia was into it and later Job joined us. It\'s a good thing, too, because we were going to be stuck with a drum machine without him and the live set wouldn\'t have been as effective.\r\n\r\nEcho No Echo is based in Portland, Oregon and we sound like electro pop rock. We\'ve joined the cool kids and started up a MySpace page. Be our friend.\r\n\r\nAfter the show with Insoc on July 29 we\'ll be heading into the studio to lay down our set, so stay tuned to this site as we\'ll be updating you on our progress. We may even post a sample or two of the songs as they\'re coming together.\r\n\r\nPictures from the July 29 show are available. Check them out on Flickr.\r\n\r\nWe played a show at Ethos Music Center on 2/1/08.\r\n\r\nIsn\'t this great? Yes, it is!'),
	(2, 'poncherello', 'Poncherello', NULL, NULL, NULL),
	(3, 'the-secret-block-project', 'The Secret Block Project', '0000', '0000', ''),
	(30, 'the-promise-breakers', 'The Promise Breakers', NULL, NULL, 'A good old band.');
/*!40000 ALTER TABLE `projects` ENABLE KEYS */;

