	(5, 1, 30, 'big-wheel-the-lost-version', 'Big Wheel (the lost version)', 'This is a song that I wrote. I like it.', 'I wish I had a big wheel\r\nBack when I was a little child\r\nOh, man that would have been real wild\r\nAt the time\r\n\r\nI really miss my skateboard\r\nWill you push me down the hill pretty-please?\r\nEven though I\'ll fall and skin my knees\r\nIt\'s worth a try', 'tear it down (open air).mp3', NULL),
